CREATE PROCEDURE dbo.proc_transform_194
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_194
    SET payload = LEFT(payload, 1000) + N'|V4-194|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_194;
END
